import React, {Component} from 'react'





class CallOut extends Component {
    constructor(props) {
        super(props);




        this.state = {

            onewaybill:[],
            ismodalvisible:false,
            loopcount:0,
            totalOutPiece:0,
            totalOutWeight:0,
            popuptop:0,
            popupleft:0


        };


        this.GetOrders = this.GetOrders.bind(this)


    }



    Closeproductmodal(){


      //  this.setState({ ismodalvisible:false});

    }

    TransferSummary(weight,piece){


        this.setState({ totalOutPiece:1+piece,totalOutWeight:1+weight,loopcount:99});

    }







    render() {


        return (


<div id="PopupWayBill" style={{"top":this.state.popuptop,"left":"750px"}}
 className={this.state.ispopupshow ? 'show ms-ContextualHost is-positioned ms-ContextualHost--arrowLeft is-open ms-ContextualHost--primaryArrow ' : 'hide'} >
   <div className="ms-ContextualHost-main">
      <div className="ms-Callout ms-Callout--arrowLeft ms-Callout--OOBE">
         <div className="ms-Callout-main">
            <div className="ms-Callout-header">
               <p className="ms-Callout-title">                
                 {this.state.totalOutPiece} Adet.                
                 {this.state.loopcount} Kez Sevk Edildi.
                   <br/>           

                 {this.state.Dimensions } {this.state.Color }   <br/>  
                  {this.state.ProductTypeName }         
                    </p>
            </div>
            <div className="ms-Callout-inner">
               <div className="ms-Callout-content">
                  <div className="ms-Callout-subText">
                  <table className="table  table-hover alert alert-primary">
                      <thead>
                      <tr className="MotionHead">
                           <td>Adet</td>
                           <td>Ağırlık</td>
                           <td>Tarih</td>
                           <td>İrsaliye</td>
                        </tr>
                      </thead>
                     <tbody>                   

                        {this.state.onewaybill.map(w =>                     
                        <tr key= {w.id}>
                           <td><b> </b> {w.Piece}   </td>    
                            <td>{w.Weight}  KG </td>
                           <td> {w.CreatedDate} </td>
                           <td><span onClick={() => this.GetWayBillPhoto(w.WayBillId)}>  {w.WayBillId}  </span></td>
                        </tr>
                        )}
                     </tbody>
                  </table>
                  </div> 
               </div>
            </div>
         </div>
      </div>
   </div>
   <div className="ms-ContextualHost-beak"  ></div>
</div>







         )
    }

    componentDidMount() { 

    }

    componentWillUnmount() {
        clearInterval(this.timer);
        this.timer = null;
    }


}

export default CallOut
